import './App.css';




function Card(props) {
   
    return (
        <main className='container-fluid'>
            <div className='card-blog-bg'></div>
            <div className='card-blog'>
                <div className='card-blog-left'>
                    <h3>{props.title}</h3>
                    <p className='card-blog-text'>{props.description}</p>
                </div>
            </div>
        </main>
    );
}

export default Card;
